import React from 'react';
import heroMobileSm from "../images/homepage/mobile/image-homepage-hero.jpg";
import heroMobileLg from "../images/homepage/mobile/image-homepage-hero@2x.jpg";

function Home({ mobileLg, tabletSm, tabletLg, desktopSm, desktopLg }) {

  return (
  	<div className="home container">

  		<img 
  		className="hero-img"
  		src={ mobileLg ? heroMobileLg : heroMobileSm}
  		alt="desktop computer showing example website" />

  	</div>
  );
}

export default Home;
